import React from "react";
import { Link } from "react-router-dom";
import { useContextGlobal } from "./utils/global.context";

//Este componente debera ser estilado como "dark" o "light" dependiendo del theme del Context

const Navbar = () => {
  const {theme, changeTheme} = useContextGlobal();

  return (
    <nav className={theme.className}>
      <div className='flex-dh'>
        <h1><span>D</span>Dentist</h1>
      </div>
      <div>
        <Link to="/" className={theme.className}>Home</Link> 
        <Link to="/contact" className={theme.className}>Contact</Link> 
        <Link to="/favs" className={theme.className}>Favs</Link> 
      {/* Aqui deberan agregar los links correspondientes a las rutas definidas */}
      {/* Deberan implementar ademas la logica para cambiar de Theme con el button */}
      <button className='darkmode' id={theme.className.dark} onClick={changeTheme}>{theme.className.dark ? 'LIGHT' : 'DARK'}</button>
      </div >
    </nav>
  )
}

export default Navbar
